INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (102301, "アヤネ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24001, 401, 0.0, 24, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (102301, "アヤネ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24002, 402, 0.0, 24, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 2.21);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (102301, "アヤネ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24003, 403, 0.0, 24, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192201, "アサヒ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24004, 701, 0.0, 24, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 1.99);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192201, "アサヒ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24005, 702, 0.0, 24, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 2.21);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192201, "アサヒ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24006, 703, 0.0, 24, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 3.33);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192301, "部員３", 0.0, "2030/12/17 14:59:59", 10046, 2, 24007, 801, 0.0, 24, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192301, "部員３", 0.0, "2030/12/17 14:59:59", 10046, 1, 24008, 802, 0.0, 24, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 2.68);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192301, "部員３", 0.0, "2030/12/17 14:59:59", 10046, 2, 24009, 803, 0.0, 24, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192501, "", 0.0, "2030/12/17 14:59:59", 10046, 1, 24010, 501, 0.0, 24, "2020/07/31 12:00:00", "やった！", 1, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192501, "", 0.0, "2030/12/17 14:59:59", 10046, 1, 24011, 502, 0.0, 24, "2020/07/31 12:00:00", "勝ったよ！", 1, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192501, "", 0.0, "2030/12/17 14:59:59", 10046, 1, 24012, 503, 0.0, 24, "2020/07/31 12:00:00", "いい調子！", 1, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 6, 24013, 111, 0.0, 24, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 5.33);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 1, 24014, 112, 0.0, 24, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 6.85);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 1, 24015, 113, 0.0, 24, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 3.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192401, "ダイチ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24016, 611, 0.0, 24, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 6.11);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192401, "ダイチ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24017, 612, 0.0, 24, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 6.75);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192401, "ダイチ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24018, 613, 0.0, 24, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113401, "ハツネ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24019, 211, 0.0, 24, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 4.52);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113401, "ハツネ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24020, 212, 0.0, 24, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 3.89);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113401, "ハツネ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24021, 213, 0.0, 24, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 13.49);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (106501, "カヤ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24022, 311, 0.0, 24, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 3.17);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (106501, "カヤ", 0.0, "2030/12/17 14:59:59", 10046, 1, 24023, 312, 0.0, 24, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 4.42);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (106501, "カヤ", 0.0, "2030/12/17 14:59:59", 10046, 6, 24024, 313, 0.0, 24, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 2.89);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (102301, "アヤネ", 0.0, "2030/12/17 14:59:59", 10046, 4, 24025, 421, 0.0, 24, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 3.71);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192201, "アサヒ", 0.0, "2030/12/17 14:59:59", 10046, 2, 24026, 721, 0.0, 24, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 5.1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192301, "部員３", 0.0, "2030/12/17 14:59:59", 10046, 1, 24027, 821, 0.0, 24, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 4.34);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (192501, "", 0.0, "2030/12/17 14:59:59", 10046, 1, 24028, 521, 0.0, 24, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 1, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 1, 24029, 101, -360.0, 24, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 5.62);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 1, 24030, 102, -360.0, 24, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 9.58);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 2, 24031, 103, -360.0, 24, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 0.0);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 2, 24032, 104, -360.0, 24, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 9.13);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (113501, "ミサト", 0.0, "2030/12/17 14:59:59", 10046, 1, 24033, 105, -360.0, 24, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 8.27);
